import mongoose from "mongoose";
import dotenv from 'dotenv'
dotenv.config()

const connectionMongo = ()=> {
    const URL = process.env.URI
    mongoose.connect(URL, {
        useNewUrlParser: true,
        useUnifiedTopology: true
    })
    .then(()=>{
        console.log('connect ok');
    })
    .catch((err) => {
        console.log(err);
    })
}

export default connectionMongo

import parseArgs from "minimist";

const config = {
    alias: {
        m: 'modo',
        p: 'puerto',
    },
    default: {
        modo: 'fork',
        puerto: '8080'
    }
} 
export const args = parseArgs(process.argv.slice(2), config)


//node server.js -m cluster -p 8082

function randomNumbers(query = 1000000) {
    let numbers = [];
    for (let i = 0; i < query; i++) {
        numbers[i] = Math.floor(Math.random() * 1000) + 1;
    }
    return numbers;
}

export default randomNumbers

//Verifico si existe un usuarion activo en la session
const verificarUser = (req, res, next) => {
    if (req.isAuthenticated()) {
        return next()
    }
    res.redirect('/login')
}

export default verificarUser

import ModelChat from "../models/modelChat.js";


const chat = async (req, res) => {
    try {
        const msjs = await ModelChat.find().lean()
        res.render('chat', { msjs: msjs })
    } catch (error) {
        console.log(error);
        res.redirect('/chat')
    }
}

const AddAndRedirectChat = async (req, res) => {
    const newMsj = req.body
    try {
        await ModelChat.create(newMsj)
        console.log('chat add');

        res.redirect('/chat')
    } catch (error) {
        console.log(error);
        res.redirect('/chat')
    }
}


export {
    AddAndRedirectChat,
    chat
}

import mongoose from 'mongoose'
import { Schema } from 'mongoose'

const collName = 'products' 

const productSchema = new Schema({
    name: {
        type: String,
        required: true
    },
    price:{ 
        type: Number,
        required: true
    },
    description: {
        type: String,
        required: true
    },
    image: {
        type: String,
        required: true
    },
    user: {
        //Con Schema.Types.ObjectId, puedo traer el Id referido ("User")
        type: Schema.Types.ObjectId,
        ref: "User",
        required: true
    }
})

const ModelProduct = mongoose.model(collName, productSchema)

export default ModelProduct

import mongoose from "mongoose";
import { Schema } from "mongoose";

const collName = 'msj'

const msjSchema = new Schema({
    name: {
        type: String,
        required: true
    },
    lastName: {
        type: String,
        required: true
    },
    mail: {
        type: String,
        required: true
    },
    message: {
        type: String,
        required: true
    }
})

const ModelChat = mongoose.model(collName, msjSchema)

export default ModelChat

